        static void Main(string[] args)
        {
            List<Double> valuesToDouble = GetNumbersToList(CsvFileContents);
            Dictionary<String, int> countValues = CountValuesDictionary(valuesToDouble);
            int max = 0;
            String key = "";
            foreach (KeyValuePair<string, int> item in countValues)
            {
                if (item.Value > max)
                {
                    max = item.Value;
                    key = item.Key;
                }
            }
            Console.WriteLine("Occurences:" + max + ", number:" + key);

        }

        private static List<Double> GetNumbersToList(String csv)
        {
            //Create a reference to an object of Number format info
            NumberFormatInfo formater = new NumberFormatInfo();
            String[] valueByValue = csv.Split(",");
            List<Double> valueByValueToDouble = new List<Double>();
            foreach (String val in valueByValue)
            {
                try
                {
                    formater.NumberDecimalSeparator = ".";
                    /*
                    I used the regex from this source:https://kaliko.com/blog/c-remove-all-non-numeric-characters/
                    */
                    String number = Regex.Replace(val, "[^.0-9]", "");
                    if (!number.Equals(""))
                    {
                        Double value = Convert.ToDouble(number, formater);
                        valueByValueToDouble.Add(value);
                    }
                }
                catch (Exception exc)
                {
                    Console.WriteLine("Exception:" + exc.Message + ".Retrying to convert using different format.");
                    formater.NumberDecimalSeparator = "..";
                    String number = Regex.Replace(val, "[^.0-9]", "");
                    Double value = Convert.ToDouble(number, formater);
                    valueByValueToDouble.Add(value);
                }
            }
            return valueByValueToDouble;
        }

        private static Dictionary<String, int> CountValuesDictionary(List<Double> valueByValueToDouble)
        {

            valueByValueToDouble.Sort();
            //The dictionary will have the following type key,value pairs:"Number",Count
            Dictionary<String, int> countValues = new Dictionary<String, int>();
            int counterCurrent = 0;
            foreach (Double searchValue in valueByValueToDouble)
            {
                //reset after every loop
                counterCurrent = 0;
                //if the key already exists this means that we already have counted it on a previous loop.
                if (!countValues.ContainsKey(Convert.ToString(searchValue)))
                {
                    foreach (Double cmpValue in valueByValueToDouble)
                    {
                        //If it's greater this means that we won't find any occurences if this value in the next loops.Hence, we are breaking.
                        if (cmpValue > searchValue)
                        {
                            break;
                        }
                        else
                        {
                            if (searchValue == cmpValue)
                            {
                                counterCurrent++;
                            }
                        }
                    }
                    countValues.Add(Convert.ToString(searchValue), counterCurrent);
                }
            }
            return countValues;
        }




